import logo from './images/meoimeoi_logo_co.png';
import LinkSection from './LinkSection';
import LinkOptions from './LinkOptions';
import { useState } from 'react';

import './meoimeoi-light-mode.css';

function Meoi() {
  console.log('hi');
  const [selected, setSelected] = useState([]);
  function selectLink(option) {
    console.log(option);
    setSelected(option);
  }
  return (
    <div className="Meoi">
      <header className="Meoi-header">
        <img src={logo} className="Meoi-logo" alt="logo" />
        {
          Object.keys(LinkOptions)
            .map((key) => <LinkSection key={key} sectionName={key} section={LinkOptions[key]} onClick={() => this.selectLink(key)} />)}
      </header>
    </div>
  );
}

export default Meoi;
